import glob, json, os
from PIL import Image
import numpy as np
from sklearn.preprocessing import normalize
import matplotlib

matplotlib.use('Agg')  # 使用非交互式后端避免显示问题
import matplotlib.pyplot as plt
import torch
import jieba
from transformers import ChineseCLIPProcessor, ChineseCLIPModel

# 检查模型设备
device = torch.device("cuda" if torch.cuda.is_available() else "cpu")
print(f"Using device: {device}")

# 加载数据
img_paths = glob.glob('./pic_10p/*.jpg')
img_paths.sort()

validation_annotations = json.load(open('./label_10t/data.json'))
validation_annotations_dict = {x['image_id']: x['caption'] for x in validation_annotations}

img_paths_basenames = [os.path.basename(x) for x in img_paths]
img_captions = [validation_annotations_dict[x] for x in img_paths_basenames]

print("图像路径:", img_paths_basenames)
print("对应标题:", img_captions)

# 重新加载模型并检查
print("加载模型...")
try:
    model = ChineseCLIPModel.from_pretrained(r"F:\ai\tools\models\chinese-clip-vit-base-patch16")
    processor = ChineseCLIPProcessor.from_pretrained(r"F:\ai\tools\models\chinese-clip-vit-base-patch16")
    model.to(device)
    model.eval()
    print("模型加载成功")
except Exception as e:
    print(f"模型加载失败: {e}")
    exit()


# 安全地加载图像函数
def safe_load_image(image_path):
    """安全加载图像，处理可能的损坏文件"""
    try:
        img = Image.open(image_path)
        # 确保图像被加载
        img.load()
        # 转换为RGB格式（避免RGBA或P模式的问题）
        if img.mode != 'RGB':
            img = img.convert('RGB')
        return img
    except Exception as e:
        print(f"无法加载图像 {image_path}: {e}")
        return None


# 修复文本特征提取函数
def get_text_features_fixed(model, processor, texts, device):
    """修复的文本特征提取方法"""
    try:
        # 确保文本是列表格式
        if isinstance(texts, str):
            texts = [texts]

        # 使用处理器处理文本
        inputs = processor(text=texts, return_tensors="pt", padding=True, truncation=True, max_length=77)
        inputs = {k: v.to(device) for k, v in inputs.items()}

        with torch.no_grad():
            # 直接使用模型获取文本特征
            text_features = model.get_text_features(**inputs)
            if text_features is not None:
                return text_features.cpu().numpy()
            else:
                print("get_text_features 返回 None，尝试替代方法")
                # 替代方法：使用文本模型直接提取特征
                text_outputs = model.text_model(**inputs)
                pooled_output = text_outputs.pooler_output
                text_features = model.text_projection(pooled_output)
                return text_features.cpu().numpy()

    except Exception as e:
        print(f"获取文本特征失败: {e}")
        # 返回零向量作为后备
        return np.zeros((len(texts), 512))


# 图像编码 - 使用安全的图像加载
print("开始图像编码...")
img_image_feat = []
valid_img_paths = []  # 存储成功加载的图像路径
valid_img_captions = []  # 存储对应的标题

# 首先检查所有图像文件
for i, path in enumerate(img_paths):
    img = safe_load_image(path)
    if img is not None:
        valid_img_paths.append(path)
        valid_img_captions.append(img_captions[i])
        print(f"成功加载图像: {os.path.basename(path)}")
    else:
        print(f"跳过损坏的图像: {os.path.basename(path)}")

print(f"成功加载 {len(valid_img_paths)} 张图像，跳过 {len(img_paths) - len(valid_img_paths)} 张损坏图像")

if len(valid_img_paths) == 0:
    print("没有可用的图像文件，程序退出")
    exit()

# 使用有效的图像路径和标题
img_paths = valid_img_paths
img_captions = valid_img_captions

# 批量处理图像
batch_size = 3
for idx in range(len(img_captions) // batch_size + 1):
    start_idx = idx * batch_size
    end_idx = (idx + 1) * batch_size
    batch_paths = img_paths[start_idx:end_idx]

    if len(batch_paths) == 0:
        break

    # 安全加载图像
    imgs = []
    valid_batch_paths = []
    for path in batch_paths:
        img = safe_load_image(path)
        if img is not None:
            imgs.append(img)
            valid_batch_paths.append(path)

    if len(imgs) == 0:
        print(f"批次 {idx} 中没有有效图像，跳过")
        continue

    try:
        inputs = processor(images=imgs, return_tensors="pt").to(device)

        with torch.no_grad():
            image_features = model.get_image_features(**inputs)
            image_features = image_features.cpu().numpy()
            img_image_feat.append(image_features)
            print(f"批次 {idx} 图像特征提取成功，形状: {image_features.shape}")
    except Exception as e:
        print(f"批次 {idx} 图像处理失败: {e}")
        continue

if len(img_image_feat) > 0:
    img_image_feat = np.vstack(img_image_feat)
    img_image_feat = normalize(img_image_feat)
    print(f"图像特征形状: {img_image_feat.shape}")
else:
    print("没有成功提取任何图像特征")
    img_image_feat = np.array([])

# 文本编码 - 使用修复的方法
print("开始文本编码...")
img_texts_feat = []
batch_size = 3

for idx in range(len(img_captions) // batch_size + 1):
    start_idx = idx * batch_size
    end_idx = (idx + 1) * batch_size
    texts = img_captions[start_idx:end_idx]

    if len(texts) == 0:
        break

    print(f"处理文本批次 {idx}: {texts}")

    # 使用修复的方法
    text_features = get_text_features_fixed(model, processor, texts, device)

    if text_features is not None:
        img_texts_feat.append(text_features)
        print(f"成功提取特征，形状: {text_features.shape}")
    else:
        print(f"批次 {idx} 的特征提取失败")
        # 创建一个零向量作为占位符
        if len(img_image_feat) > 0:
            placeholder = np.zeros((len(texts), img_image_feat.shape[1]))
        else:
            placeholder = np.zeros((len(texts), 512))  # 假设特征维度为512
        img_texts_feat.append(placeholder)

if len(img_texts_feat) > 0:
    img_texts_feat = np.vstack(img_texts_feat)
    img_texts_feat = normalize(img_texts_feat)
    print(f"文本特征形状: {img_texts_feat.shape}")

    # 进行相似度计算
    if len(img_image_feat) > 0 and len(img_texts_feat) > 0:
        query_idx = min(2, len(img_texts_feat) - 1)  # 确保索引不越界

        # 文本到图像检索
        sim_result = np.dot(img_texts_feat[query_idx], img_image_feat.T)
        sim_idx = sim_result.argsort()[::-1][1:4]

        print('输入文本: ', img_captions[query_idx])
        print('最相似的图像索引: ', sim_idx)
        print('相似度分数: ', [sim_result[i] for i in sim_idx])

        # 保存结果图像而不是显示
        fig, axes = plt.subplots(1, 3, figsize=(12, 4))
        for i, idx in enumerate(sim_idx):
            if idx < len(img_paths):
                img = safe_load_image(img_paths[idx])
                if img is not None:
                    axes[i].imshow(img)
                    axes[i].set_title(f'Rank {i + 1}, Sim: {sim_result[idx]:.3f}')
                    axes[i].axis('off')
                else:
                    axes[i].text(0.5, 0.5, f"无法加载图像\n{os.path.basename(img_paths[idx])}",
                                 ha='center', va='center', transform=axes[i].transAxes)
                    axes[i].axis('off')
            else:
                axes[i].text(0.5, 0.5, "无效的图像索引",
                             ha='center', va='center', transform=axes[i].transAxes)
                axes[i].axis('off')
        plt.tight_layout()

        # 保存图像而不是显示
        output_path = "similarity_results.png"
        plt.savefig(output_path, dpi=150, bbox_inches='tight')
        print(f"结果已保存到: {output_path}")

        # 显示查询图像
        query_img = safe_load_image(img_paths[query_idx])
        if query_img is not None:
            plt.figure(figsize=(5, 5))
            plt.imshow(query_img)
            plt.title(f'查询图像: {img_captions[query_idx]}')
            plt.axis('off')
            query_output_path = "query_image.png"
            plt.savefig(query_output_path, dpi=150, bbox_inches='tight')
            print(f"查询图像已保存到: {query_output_path}")

else:
    print("文本特征提取完全失败")

# 尝试使用更简单的方法进行文本特征提取
print("\n尝试使用简化方法进行文本特征提取...")
try:
    # 使用模型直接处理单个文本
    test_text = "测试"
    inputs = processor(text=test_text, return_tensors="pt", padding=True, truncation=True, max_length=77)
    inputs = {k: v.to(device) for k, v in inputs.items()}

    with torch.no_grad():
        test_features = model.get_text_features(**inputs)
        if test_features is not None:
            print(f"简化方法成功，特征形状: {test_features.shape}")
        else:
            print("简化方法返回 None")
except Exception as e:
    print(f"简化方法失败: {e}")

